import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import logo from "./Images/logo.png";
import Image from 'react-bootstrap/Image';
import { LinkContainer } from "react-router-bootstrap";
import Button from 'react-bootstrap/Button';


// const NavbarComponent = () => {

//   return (
//     <Container classname="Navigation">
//       <Image src={logo} className="logo" />
//       <Navbar>
//         <Container>
//           <Nav className="NavBar">
//             <Nav.Link href="#home">Home</Nav.Link>
//             <Nav.Link href="#features">Schedule</Nav.Link>
//             <Nav.Link href="#pricing">Learning</Nav.Link>
//             <Nav.Link href="#features">Profile</Nav.Link>
//             <Nav.Link href="#pricing">Notification</Nav.Link>
//             <Nav.Link href="#features">Login in</Nav.Link>
//             <Nav.Link href="#pricing">Sign Up</Nav.Link>
//           </Nav>
//         </Container>
//       </Navbar>
//     </Container>
//   );
// }
 
// export default NavbarComponent;
const NavbarComponent = () => {
  return (
    <Navbar expand="lg" className="nav">
      <Container className="container-fluid" fluid>
        <LinkContainer to="/">
          <Navbar.Brand href="#home" id="logo">
            <img src={logo} alt="logo" id="logo" />
          </Navbar.Brand>
        </LinkContainer>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <LinkContainer to="/">
              <Nav.Link className="link1 lk1">Home</Nav.Link>
            </LinkContainer>
            <LinkContainer to="/Scheduke">
              <Nav.Link className="link1 lk5">FAQ</Nav.Link>
            </LinkContainer>
            <LinkContainer to="/review">
              <Nav.Link className="link1 lk6">Reviews</Nav.Link>
            </LinkContainer>
            <LinkContainer to="/login">
              <Nav.Link>
                <Button className="btnlog link1"> Login</Button>
              </Nav.Link>
            </LinkContainer>
            <LinkContainer to="/getstarted">
              <Nav.Link>
                <Button className="btnsub lkgs" type="submit">
                  {" "}
                  Get started
                </Button>
              </Nav.Link>
            </LinkContainer>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default NavbarComponent;
